import React, { useState} from 'react';
import axios from 'axios';
// Import AuthService without extra spaces or typos
import { AuthService } from './AuthService ';


export default function Register(){

    
    const[txtEmail,setEmail]=useState("");
    const[txtName,setName]=useState("");
    const[txtAddress,setAddress]=useState("");
    const[txtGender,setGender]=useState("");
    const[txtcontactno,setcontactno]=useState("");
    const[txtPassword,setPassword]=useState("");
    const[txtNic,setNic]=useState("");

    const [fileImage, setImage] = useState();

    function sendData(e){
        e.preventDefault();

        if (!fileImage) {
            console.error("Image not selected");
            return;
        }

        const formData=new FormData();
        formData.append('image',fileImage);
        formData.append('email',txtEmail);
        formData.append('name',txtName);
        formData.append('password',txtPassword);
        formData.append('address',txtAddress);
        formData.append('nic',txtNic);
        formData.append('contactno',txtcontactno);
        formData.append('gender',txtGender);
        
        console.log(formData);

        axios.post("http://localhost:6060/User/add", formData).then(()=>{
            alert("User added successfully");
            console.log("User added successfully");
        }).catch((err)=>{
            alert("User not added",err);
            console.log("User not added",err );
        });
        

    }
    
    const backgroundImageUrl = 'http://localhost:6060/images/jeba.png';

    const divStyle = {
    backgroundImage: `url(${backgroundImageUrl})`,
    backgroundRepeat: 'no-repeat',
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    backgroundAttachment: 'fixed',
    // Add other background-related styles as needed
};

   
    return(

      
      <div className="limiter">
      <div className="container-login100" style={{ ...divStyle, width: "100%", height: "100vh" }}>
        <div className="wrap-login100" style={{ marginLeft: "-50%" }}>
    
          <form className="login100-form validate-form" onSubmit={sendData}>
            <span style={{ marginLeft: "-80px", fontSize: "32px", color: "black", fontWeight: "bolder" }}>
              Sign <span style={{ color: "#fe5b29" }}>In</span>
            </span>
    
            {/* First 4 text fields in one column */}
            <div className="wrap-input100 validate-input" data-validate="Password is required">
              <input className="form-control" style={{ width: "200px", marginLeft: "35%", marginTop: "7%" }} type="text" name="pass" placeholder="name" onChange={(e) => { setName(e.target.value); }} />
            </div>
    
            <div className="wrap-input100 validate-input" data-validate="Valid email is required: ex@abc.xyz">
              <input className="form-control" style={{ width: "200px", marginLeft: "35%", marginTop: "20px" }} type="text" name="email" placeholder="Email" onChange={(e) => { setEmail(e.target.value); }} />
            </div>
    
            <div className="wrap-input100 validate-input" data-validate="Password is required">
              <input className="form-control" style={{ width: "200px", marginLeft: "35%", marginTop: "20px" }} type="text" name="pass" placeholder="Address" onChange={(e) => { setAddress(e.target.value); }} />
            </div>
    
            <div className="wrap-input100 validate-input" data-validate="Password is required">
              <input className="form-control" style={{ width: "200px", marginLeft: "35%", marginTop: "20px" }} type="text" name="pass" placeholder="NIC" onChange={(e) => { setNic(e.target.value); }} />
            </div>
            <div className="wrap-input100 validate-input" data-validate="Password is required">
              <select className="form-control" style={{ width: "200px", marginLeft: "35%", marginTop: "20px" }} name="pass" onChange={(e) => { setGender(e.target.value); }}>
                <option value="Auto">male</option>
                <option value="Manual">female</option>
              </select>
            </div>
    
            {/* Left-aligned column for the rest of the fields */}
            
    
            <div className="wrap-input100 validate-input" data-validate="Password is required">
              <input className="form-control" style={{ width: "200px", marginLeft: "50%",marginTop:"-13.2%" }} type="text" name="pass" placeholder="Contact No" onChange={(e) => { setcontactno(e.target.value); }} />
            </div>
    
            <div className="wrap-input100 validate-input" data-validate="Password is required">
              <input className="form-control" style={{ width: "200px", marginLeft: "50%", marginTop: "20px" }} type="file" onChange={(e) => { setImage(e.target.files[0]); }} />
            </div>
    
            <div className="wrap-input100 validate-input" data-validate="Password is required">
              <input className="form-control" style={{ width: "200px", marginLeft: "50%", marginTop: "20px"}} type="text" name="pass" placeholder="Password" onChange={(e) => { setPassword(e.target.value); }} />
            </div>
    
            <div className="wrap-input100 validate-input" data-validate="Password is required">
              <input className="form-control" style={{ width: "200px", marginLeft: "50%", marginTop: "20px"}} type="text" name="pass" placeholder="Confirm Password" />
            </div>
    
            <div className="container-login100-form-btn">
              <button type="submit" style={{ width: "100px", marginTop: "20px", marginLeft: "-85px", backgroundColor: "#fe5b29" }} className="btn btn-primary mb-3" id="submit">Sign In</button>
            </div>
          </form>
        </div>
      </div>
    </div>
    
      
    )
  }
